import React, { Fragment } from 'react';
import Die from './die'


function Row({rowRolls }) {
    console.log(`printing row with ${rowRolls.length} columns`)

    let diceInRow = []
    for (let [index, value] of rowRolls.entries()) {
        console.log(`sending die index ${index+1} letter ${value}` )
        diceInRow.push(<td key={index.toString()}><Die key={index.toString()} id={index.toString()} roll={value}/></td>)
    }
    console.log(diceInRow)
    return (diceInRow)
}

export default Row
